# Part 2: Logical and physical design 
# DDL part
drop database IF EXISTS Music_man;
CREATE DATABASE Music_man;
Use Music_man;
CREATE TABLE customers
(
Customer_id varchar(255),
LastName varchar(255),
FirstName varchar(255),
Address varchar(255),
PRIMARY KEY (Customer_id)  
);
CREATE TABLE Orders
(
Order_id int,
order_date date,
Customer_id varchar(255),
employee_id varchar(255),
PRIMARY KEY (Order_id )  
);
CREATE TABLE Orders_details
(
Order_detail_id varchar(255),
Order_id int,
item_id varchar(255),
quantity int,
PRIMARY KEY (Order_detail_id )  
);
CREATE TABLE Stock
(
item_id varchar(255),
product_name varchar(255),
quantity int,
price decimal(15,2),
supplier_id varchar(255),
PRIMARY KEY (item_id )  
);
CREATE TABLE Supplier
(
supplier_id varchar(255),
address varchar (255),
name varchar(255),
phone varchar(255),
PRIMARY KEY (supplier_id )  
);
create table employees
(
employee_id varchar(255),
address varchar (255),
name varchar(255),
phone varchar(255),
salary_yearly VARCHAR(5),
start_date DATE,
role VARCHAR(7),
PRIMARY KEY (employee_id)  
);


