#view for total expenditure in salaries and total number of employee
create view salaries as
select count(employee_id) as number_of_employees, SUM(salary_yearly) as Total_salaries, ROUND(AVG(salary_yearly),0) as average_salary from employees;

select * from salaries;

#view about financial status
create VIEW financial AS
select SUM(orders_details.quantity * price) as profit_before_tax, '20%' as tax_rate,
SUM(orders_details.quantity * price)* 0.8 as after_tax, (SELECT Total_salaries from salaries) as Salaries, 
SUM(orders_details.quantity * price)* 0.8 - (SELECT Total_salaries from salaries) as net_profit 
from orders_details join stock on orders_details.item_id = stock.item_id
join orders on orders.Order_id = orders_details.Order_id;

select * from financial;

#creating total billing procedure

drop procedure IF EXISTS order_billing;
create PROCEDURE order_billing (IN ORDER_ID int(255))
SELECT orders.Customer_id, concat(FirstName, ' ', LastName) as name,
 order_date, Order_id, SUM(orders_details.quantity) AS number_of_items,
SUM(price * orders_details.quantity) as total_pay
from orders_details
inner join orders
on orders.Order_id = orders_details.Order_id
inner join customers as a
on a.Customer_id = orders.Customer_id
left join stock 
on stock.item_id = orders_details.item_id
where orders_details.Order_id = ORDER_ID;

call order_billing(2);

#creating subtotal procedure

drop procedure IF EXISTS order_sub_total;
create PROCEDURE order_sub_total (IN ORDER_ID int(255))
SELECT orders.Order_id, order_date, Customer_id, stock.item_id, product_name, orders_details.quantity, price, price * orders_details.quantity as sub_total
FROM orders join orders_details
on orders.Order_id = orders_details.Order_id
join stock on stock.item_id = orders_details.item_id
where orders.Order_id = ORDER_ID;

call order_sub_total(2);

