#	2.   Create a stored procedure that takes the start and end dates of the sales and
# display all the sales transactions between the start and the end dates. (You decide the dates)    

drop procedure IF EXISTS sales_date;
create PROCEDURE sales_date(IN date_1 date, date_2 date )
 SELECT a.Order_id, SUM(price * b.quantity) as order_transaction_amount
 FROM mUsic_man.orders as a
 join orders_details as b
 on a.order_id = b.order_id
 join stock as c
 on c.item_id = b.item_id
 WHERE order_date BETWEEN date_1 AND date_2
 group by Order_id;
 
CALL sales_date('2022-01-02', '2022-03-15');

#    3.	Create a view that shows the total number of items a customer buys
#     from the business in October 2022 along with the total price (use group by)       

create VIEW customer_october AS
SELECT Customer_id, order_date, SUM(price * orders_details.quantity) as total_pay, SUM(orders_details.quantity) as total_items
from orders_details
inner join orders
on orders.Order_id = orders_details.Order_id
left join stock 
on stock.item_id = orders_details.item_id
where order_date between '2022-10-01' and '2022-10-31'
group by Customer_id ;

select * from customer_october
order by order_date;

#    4.	Create a trigger that adjusts the stock level every time a product is sold.

DELIMITER $$
 CREATE TRIGGER Stock_trigger 
 AFTER INSERT ON orders_details
 FOR EACH ROW 
  BEGIN 
    UPDATE stock
      SET stock.quantity = stock.quantity - New.quantity 
    WHERE stock.item_id = New.item_id;
  END$$
DELIMITER ;

