#    5.	Create a report of the annual sales (2022) of the business showing the total number of products sold and the total 
#     price sold every month (use A group by with roll-up)

SELECT 
COALESCE(month(order_date),'Total') AS month,
SUM(price * orders_details.quantity) as total_sales, 
SUM(orders_details.quantity) as items_sold
from orders_details
inner join orders
on orders.Order_id = orders_details.Order_id
left join stock 
on stock.item_id = orders_details.item_id
GROUP BY MONTH(order_date) WITH ROLLUP;

# 6.	Display the growth in sales/services (as a percentage) for your business, from the 1st month of opening until now. 

#creating a view with total sales by months untill now using '(current_date())'
create view monthly_sales as
SELECT
MONTH(ORDER_DATE) AS month,MONTHNAME(ORDER_DATE) as month_name,
SUM(price * orders_details.quantity) as total_sales
from orders_details
inner join orders
on orders.Order_id = orders_details.Order_id
left join stock 
on stock.item_id = orders_details.item_id
where order_date between '01-01-2022' and CURRENT_DATE()
GROUP BY MONTH(order_date)
ORDER BY MONTH(order_date);


#in case we want all year data
create view monthly_sales_all_year as
SELECT
MONTH(ORDER_DATE) AS month,MONTHNAME(ORDER_DATE) as month_name,
SUM(price * orders_details.quantity) as total_sales
from orders_details
inner join orders
on orders.Order_id = orders_details.Order_id
left join stock 
on stock.item_id = orders_details.item_id
GROUP BY MONTH(order_date)
ORDER BY MONTH(order_date);


#Select statement for displaying growth in sales and percentages changes against previous month (untill today)
SELECT  month, month_name,
        total_sales,
        coalesce(total_sales - LAG (total_sales) OVER (ORDER BY month ASC),0) AS revenue_growth,
        coalesce((total_sales - LAG (total_sales) OVER (ORDER BY month ASC))/LAG (total_sales)
        OVER (ORDER BY month ASC)*100 ,0)AS revenue_percentage_growth
FROM monthly_sales;

#Select statement for displaying growth in sales and percentages changes against previous month (untill end of the year)
SELECT  month, month_name,
        total_sales,
        coalesce(total_sales - LAG (total_sales) OVER (ORDER BY month ASC) ,0)AS revenue_growth,
        coalesce((total_sales - LAG (total_sales) OVER (ORDER BY month ASC))/LAG (total_sales)
        OVER (ORDER BY month ASC)*100 ,0)AS revenue_percentage_growth
FROM monthly_sales_all_year;


